import React from "react";
// import Navbar from "./Navbar"



const Home = () => {
    React.useEffect( () => {
        fetchFlavors();
    }, []);

    const [flavors, setFlavors] = React.useState([]);

    const fetchFlavors = async () => {
        const data = await fetch("/");
        const items = await data.json();

        setFlavors(items);

        console.log(items);
    }

    return (
        <div>
            <ul>
            {flavors.map(item => {
                    <li>{item.name}</li>
                })}
            </ul>
        </div>
    );
}

export default Home;
